import React from 'react';
import logo from '../Images/logo.png';

const Footer = () => {
    return (
        <>
            <section className="footer">
                <div className="d-flex flex-row m-auto logoName">
                    <img src={logo} alt="" className="logostyle" />
                    <h5>opus</h5>
                </div>
            </section>
        </>
    );
};

export default Footer;
